import React from 'react';
import PopulateCharacters from './PopulateCharacters';

function ShowUserCharacters(props){
    console.log(props.currentUser.characters)

    props.currentUser.characters.forEach(character => {
        // console.log(character)
        return(
            <div className="UserCharacters">
                {PopulateCharacters(character)}
            </div>
        )
    })

}

export default ShowUserCharacters;
